import React from 'react';

function Checkbox (props){
    
    const data = props.data;
    const typeInput = props.type;


 
    return(
        <div onClick={props.onclick(typeInput)}>
        
            <label 
                    htmlFor={props.id}
                    className={props.classNameLabel}
            >
                {props.label}
            </label>
            
            <label
                className={props.classNameCheckbox}
            >
                <input
                        id = {props.id}
                        type = {props.type}
                        onChange={(event) => props.onchange(event, typeInput, data)}
                        checked={props.checked}
                        tabIndex = {props.tabindex}
                />
                <span className="fa fa-check" aria-hidden="true"></span>
            </label>
        </div>
    )
}

export default Checkbox
